import React, { Component } from 'react'

import { Link } from 'react-router-dom'
export class Menu extends Component {
    

    render() {
        return (
            <>
            <Link  to="/">Home</Link><t/>
            <Link  to="/1">About</Link>
            <Link  to="/2">Contact</Link>
         
            </>
        )
    }
}

export default Menu
